import React from 'react';
import { Route, Switch } from 'react-router-dom';
import Home from './Home';

const MainRouter = () => (
    <div>
        <Switch>
            <Route exact="/" component={Home} ></Route>
        </Switch>
    </div>
)

export default MainRouter;
